import React, { useState, useEffect } from 'react';
import { Container, Card, Table, Button, Modal, Form } from 'react-bootstrap';
import api from '../../axiosConfig';
import Select from 'react-select';

const Inventory = () => {
  const [inventory, setInventory] = useState([]);
  const [selectedInventory, setSelectedInventory] = useState(null);
  const [showEditModal, setShowEditModal] = useState(false);
  const [showDeleteModal, setShowDeleteModal] = useState(false);
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    sku: '',
    buy_price: '',
    sale_price: '',
    image_url: '',
    in_stock: false,
  });

  useEffect(() => {
    fetchInventory();
  }, []);

  const fetchInventory = async () => {
    try {
      const response = await api.get('/inventory');
      setInventory(response.data);
    } catch (error) {
      console.error('Error fetching inventory:', error);
    }
  };

  const handleEditClick = (item) => {
    setSelectedInventory(item);
    setFormData({
      name: item.name,
      description: item.description,
      sku: item.sku,
      buy_price: item.buy_price,
      sale_price: item.sale_price,
      image_url: item.image_url,
      in_stock: item.in_stock,
    });
    setShowEditModal(true);
  };

  const handleDeleteClick = (item) => {
    setSelectedInventory(item);
    setShowDeleteModal(true);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleUpdateInventory = async () => {
    try {
      await api.put(`/inventory/${selectedInventory.id}`, formData);
      setShowEditModal(false);
      fetchInventory();
    } catch (error) {
      console.error('Error updating inventory:', error);
    }
  };

  const handleDeleteInventory = async () => {
    try {
      await api.delete(`/inventory/${selectedInventory.id}`);
      setShowDeleteModal(false);
      fetchInventory();
    } catch (error) {
      console.error('Error deleting inventory:', error);
    }
  };

  return (
    <Container>
      <Card className="p-4 mb-4">
        <Card.Title>Inventory Management</Card.Title>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Name</th>
              <th>SKU</th>
              <th>Buy Price</th>
              <th>Sale Price</th>
              <th>In Stock</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {inventory.map(item => (
              <tr key={item.id}>
                <td>{item.name}</td>
                <td>{item.sku}</td>
                <td>${item.buy_price}</td>
                <td>${item.sale_price}</td>
                <td>{item.in_stock ? 'Yes' : 'No'}</td>
                <td>
                  <Button variant="warning" onClick={() => handleEditClick(item)}>Edit</Button>{' '}
                  <Button variant="danger" onClick={() => handleDeleteClick(item)}>Delete</Button>{' '}
                  <Button variant="info">View</Button>
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </Card>

      {/* Edit Modal */}
      <Modal show={showEditModal} onHide={() => setShowEditModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Edit Inventory</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group controlId="formName">
              <Form.Label>Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter name"
                name="name"
                value={formData.name}
                onChange={handleInputChange}
              />
            </Form.Group>

            <Form.Group controlId="formDescription">
              <Form.Label>Description</Form.Label>
              <Form.Control
                as="textarea"
                placeholder="Enter description"
                name="description"
                value={formData.description}
                onChange={handleInputChange}
              />
            </Form.Group>

            <Form.Group controlId="formSKU">
              <Form.Label>SKU</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter SKU"
                name="sku"
                value={formData.sku}
                onChange={handleInputChange}
              />
            </Form.Group>

            <Form.Group controlId="formBuyPrice">
              <Form.Label>Buy Price</Form.Label>
              <Form.Control
                type="number"
                placeholder="Enter buy price"
                name="buy_price"
                value={formData.buy_price}
                onChange={handleInputChange}
              />
            </Form.Group>

            <Form.Group controlId="formSalePrice">
              <Form.Label>Sale Price</Form.Label>
              <Form.Control
                type="number"
                placeholder="Enter sale price"
                name="sale_price"
                value={formData.sale_price}
                onChange={handleInputChange}
              />
            </Form.Group>

            <Form.Group controlId="formImageURL">
              <Form.Label>Image URL</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter image URL"
                name="image_url"
                value={formData.image_url}
                onChange={handleInputChange}
              />
            </Form.Group>

            <Form.Group controlId="formInStock">
              <Form.Check
                type="checkbox"
                label="In Stock"
                name="in_stock"
                checked={formData.in_stock}
                onChange={(e) => setFormData({ ...formData, in_stock: e.target.checked })}
              />
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowEditModal(false)}>
            Cancel
          </Button>
          <Button variant="primary" onClick={handleUpdateInventory}>
            Update
          </Button>
        </Modal.Footer>
      </Modal>

      {/* Delete Modal */}
      <Modal show={showDeleteModal} onHide={() => setShowDeleteModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Delete Inventory</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          Are you sure you want to delete {selectedInventory?.name}?
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowDeleteModal(false)}>
            No
          </Button>
          <Button variant="danger" onClick={handleDeleteInventory}>
            Yes
          </Button>
        </Modal.Footer>
      </Modal>
    </Container>
  );
};

export default Inventory;
